INSERT INTO AWARD_SYNC_LOG (AWARD_SYNC_LOG_ID,AWARD_SYNC_STATUS_ID,AWARD_SYNC_CHANGE_ID,SUCCESS,LOG_TYPE_CODE,STATUS,UPDATE_USER,UPDATE_TIMESTAMP,OBJ_ID,VER_NBR) 
    VALUES (SEQ_AWARD_SYNC_LOG_ID.NEXTVAL,(SELECT AWARD_SYNC_STATUS_ID FROM AWARD_SYNC_STATUS WHERE AWARD_ID = (SELECT AWARD_ID FROM AWARD WHERE AWARD_NUMBER = '001002-00002' AND SEQUENCE_NUMBER = '2') AND STATUS = 'Completed'),(SELECT AWARD_SYNC_CHANGE_ID FROM AWARD_SYNC_CHANGE WHERE AWARD_ID = (SELECT AWARD_ID FROM AWARD WHERE AWARD_NUMBER = '001002-00001' AND SEQUENCE_NUMBER = 2) AND DATA_DESC = '000340 : NIH'),'Y','CL','Success','quickstart',SYSDATE,SYS_GUID(),0)
/
